async function generatePDF(fullname,exam_title,en_score,math_score,total_score,dt_exam,st_id) {
	const { jsPDF } = window.jspdf;
	const doc = new jsPDF();
	let img = "data:image/png;base64,";
	// Header & Logo
	doc.setFillColor(41, 128, 185); // Blue header
	doc.rect(0, 0, 210, 30, 'F');
	doc.setTextColor(255, 255, 255);
	doc.setFont("Helvetica", "bold");
	doc.setFontSize(18);
	doc.text("SAT Examination Results", 105, 20, null, null, "center");
	
	
	
	doc.setTextColor(0);
	doc.setFontSize(10);
	doc.addImage(img, 'PNG', 10, 10, 50,15);

	// Candidate Info Section
	doc.setFontSize(12);
	doc.setFont("Helvetica", "normal");
	doc.text("Candidate Information", 20, 40);
	doc.line(20, 42, 190, 42);

	let dt = new Date(dt_exam);
	const monthNames = ["January", "February", "March", "April", "May", "June",
		"July", "August", "September", "October", "November", "December"
	  ];
	const info = [
	  ["Name:", fullname],
	  ["Student ID:", st_id],
	 
	  ["Test Date:", monthNames[dt.getMonth()]+" "+dt.getDay().toString()+" "+dt.getFullYear().toString()],
	];

	let y = 48;
	info.forEach(row => {
	  doc.text(row[0], 25, y);
	  doc.text(row[1], 70, y);
	  y += 8;
	});

	// Scores Section
	doc.setFont("Helvetica", "bold");
	doc.text("Section Scores", 20, y + 8);
	doc.line(20, y + 10, 190, y + 10);

	doc.setFont("Helvetica", "normal");
	const scores = [
	  ["Reading & Writing", en_score],
	  ["Mathematics", math_score],
	];

	y += 18;
	scores.forEach(score => {
	  doc.rect(25, y - 6, 160, 10); // Score box
	  doc.text(score[0], 30, y);
	  doc.text(score[1], 170, y, null, null, "right");
	  y += 14;
	});

	// Total Score
	doc.setFont("Helvetica", "bold");
	doc.setFontSize(14);
	doc.setTextColor(41, 128, 185);
	doc.text("Total Score: "+total_score, 105, y + 10, null, null, "center");

	// Footer
	doc.setFontSize(9);
	doc.setFont("Helvetica", "italic");
	doc.setTextColor(100);
	doc.text("This is a system-generated document and does not require a signature.", 105, 285, null, null, "center");

	// Save PDF
	doc.save(fullname+"_SAT_Result.pdf");
  }
